{'time': 1611859500506, 'text': "Hi Benita,
Since you were turned away that means you came in after our cut off. The cut off is not static and varies on the amount of people that come in. We recommend coming in early before we open and waiting in line to get signed up. You greatly reduce your chances of getting in especially at the end of the month, if you come in after 10 in the morning. It's not that we don't sympathize with peoples situations, but we have very strict rules in place for a reason.

Thanks for your input. Hope this helps."}
